  \"2016-07-15T04:24:24.576830\",\n\t\"name\": \"global-tobacco-surveillance-system-gtss-global-health-professions-student-survey-ghpss\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>2005-2011. The World Health Organization,
  CDC, and the Canadian Public Health Association, developed the GHPSS to collect
  data on tobacco use and cessation counseling among health professional students
  in all WHO member states. GHPSS is a standardized school-based survey of third-year
  students pursuing advanced degrees in dentistry, medicine, nursing, or pharmacy.
  It is conducted in schools during regular class sessions. GHPSS follows an anonymous,
  self-administered format for data collection. GHPSS uses a core questionnaire on
  demographics, prevalence of cigarette smoking and other tobacco use, knowledge and
  attitudes about tobacco use, exposure to secondhand smoke, desire for smoking cessation,
  and training received regarding patient counseling on smoking cessation techniques.
  Questionnaires are translated into local languages as needed. GHPSS has a standardized
  methodology for selecting participating schools and classes and uniform data processing
  procedures.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
